import React, { Component } from "react";

class UserGreeting extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isLoggedin: false,
    };
  }

  render() {
    let message;
    if (this.state.isLoggedin) {
      message = <div>Welcome Ravina</div>;
    } else {
      message = <div>Welcome Guest</div>;
    }
    return <div>{message}</div>;

